import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import firebase from "firebase"

//auth
var config = {
 apiKey: "AIzaSyBdD-dZnTara6z3jjKOENeqWQJz8Lk53jQ",
 authDomain: "fir-auth-b1ee0.firebaseapp.com",
};
firebase.initializeApp(config);

class Form extends React.Component {
constructor(props) {
  super(props);
  this.state = {
    isSignedIn: false,
    modal:"login",
    confirmDirty: false,
    autoCompleteResult: [],
    dismiss:"none",
    LoginerrorMessage:" ",
    SignuperrorMessage:" "
  }}


  handleSubmitLogin = (e) => {
    e.preventDefault();
          this.props.form.validateFields((err, values) => {
            if (!err) {

              firebase.auth().signInWithEmailAndPassword(values.userName, values.password)
              .then(user=>{let data=user.user
                 this.setState({isSignedIn:true,
                                LoginerrorMessage:" "
                                })
               return this.props.setStates(data) })
              .catch(error=> {
                // Handle Errors here.
                var errorCode = error.code;
                var errorMessage = error.message;
                console.log(errorMessage);
                this.setState({
                  LoginerrorMessage:"Sorryy! gievn email or password didnt match ,try forgot password if you need help resetting"
                });

              });
            }
          });


        }
  handleSubmitSignup = (e) => {
    e.preventDefault();
    this.props.form.validateFieldsAndScroll((err, values) => {
      if (!err) {

      var promise= new Promise((resolve,reject)=>resolve(firebase.auth().createUserWithEmailAndPassword(values.email, values.password)))
      promise.then(user=>{
            user.user.updateProfile({
              displayName: values.nickname,
                photoURL: "https://cdn.dribbble.com/users/199982/screenshots/4044699/furkan-avatar-dribbble.png"
            }).then(function() {
              // Update successful.
            }).catch(function(error) {
              // An error happened.
            });
            this.setState({
                          SignuperrorMessage:" ",
                          modal:"login",
                        })}  )
      .catch(error=> {
        // Handle Errors here.
        var errorCode = error.code;
        var errorMessage = error.message;
        this.setState({
          SignuperrorMessage:errorMessage
        });

      });



      }
    });
  }

    compareToFirstPassword = (rule, value, callback) => {
      const form = this.props.form;
      if (value && value !== form.getFieldValue('password')) {
        callback('Two passwords that you enter is inconsistent!');
      } else {
        callback();
      }
    }

    validateToNextPassword = (rule, value, callback) => {
      const form = this.props.form;
      if (value && this.state.confirmDirty) {
        form.validateFields(['confirm'], { force: true });
      }
      callback();
    }

    displaySignup = ()=>{
      return this.setState({modal:"signup"})
    }
    displayLogin = ()=>{
      return this.setState({modal:"login"})
    }


  handleClickOpen = () => {
    this.setState({ open: true });
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  render() {
    return (
      <React.Fragment>
      {
        this.state.modal==="login" ?

      <React.Fragment>
          <DialogTitle id="form-dialog-title">{this.state.isSignedIn}</DialogTitle>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Email Address"
              type="email"
              fullWidth
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={this.handleSubmitLogin} color="primary">
              Submit
            </Button>
          </DialogActions>
      </React.Fragment>
      :
      <React.Fragment>
      <DialogTitle id="form-dialog-title">{this.state.isSignedIn}</DialogTitle>
      <DialogContent>
        <TextField
          autoFocus
          margin="dense"
          id="name"
          label="Email Address"
          type="email"
          fullWidth
        />
      </DialogContent>
      </React.Fragment>
      }
      </React.Fragment>
    );
  }
}

export default Form
